// src/HotelList.js
import React, { useState, useEffect } from 'react';
import './HotelList.css'; // Import the CSS file for styling
import HotelDetailsModal from './HotelDetailsModal';

const baseUrl = 'https://food-app-be-sequelize.onrender.com';

const HotelList = () => {
  const [hotels, setHotels] = useState([]);
  const [selectedHotel, setSelectedHotel] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Mock data to simulate fetching from an API
  useEffect(() => {
    const fetchHotels = async () => {
        try {
          const response = await fetch(`${baseUrl}/gethotels`);
          if (!response.ok) {
            throw new Error('Network response was not ok');
          }
          const data = await response.json();
          setHotels(data);
        } catch (error) {
          setError(error.message);
        } finally {
          setLoading(false);
        }
      };

      fetchHotels();
  }, []);

  const handleCloseModal = () => {
    setShowModal(false);
    setSelectedHotel(null);
  };

  const handleHotelSelect = (hotelId) => {
    // Mock fetching details for selected hotel
    const selectedHotelDetails = {
      hotelId: hotelId,
      signatureDishes: [
        { hotelSignatureDishId: 1, dishName: 'Spaghetti Bolognese', dishPrice: '$12.99', dishCategory: 'Main Course' },
        { hotelSignatureDishId: 2, dishName: 'Caesar Salad', dishPrice: '$8.99', dishCategory: 'Appetizer' }
      ],
      timings: {
        morning: '8:00 AM - 11:00 AM',
        noon: '12:00 PM - 3:00 PM',
        evening: '6:00 PM - 9:00 PM',
        lateNight: true
      }
    };

    setSelectedHotel(selectedHotelDetails);
    setShowModal(true);
  };

  const handleApprove = (hotelId) => {
    // Approve logic can go here
    console.log(`Hotel with ID ${hotelId} approved.`);
    alert(`Hotel with ID ${hotelId} approved.`);
  };

  // Display loading indicator if data is being fetched
  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  // Display error message if an error occurs
  if (error) {
    return <div className="error-message">Error: {error}</div>;
  }

  return (
    <div className="hotel-list-container">
      <h1>Hotel List</h1>
      <table className="hotel-table">
        <thead>
          <tr>
            <th>DataEntry Number</th>
            <th>Name</th>
            <th>Address</th>
            <th>City</th>
            <th>Rating</th>
            <th>Phone</th>
            <th>Map Location</th>
            <th>Vlog Video</th>
            <th>View Count</th>
            <th>Post Date</th>
            <th>Approve</th>
          </tr>
        </thead>
        <tbody>
          {hotels.map((hotel) => (
            <tr key={hotel.hotelId}>
                <td>{hotel.userMobileNumber}</td>
              <td onClick={() => {handleHotelSelect(hotel.hotelId)}}>{hotel.hotelName}</td>
              <td>{hotel.hotelAddress}</td>
              <td>{hotel.hotelCity}</td>
              <td>{hotel.hotelRating}</td>
              <td>{hotel.hotelPhone}</td>
              <td>
                <a href={hotel.hotelMapLocationLink} target="_blank" rel="noopener noreferrer">View on Map</a>
              </td>
              <td>
                <a href={hotel.hotelVlogVideoLink} target="_blank" rel="noopener noreferrer">Watch Video</a>
              </td>
              <td>{hotel.vlogVideoViewCount}</td>
              <td>{hotel.vlogPostDate}</td>
              <td>
                <button className="approve-button" onClick={() => handleApprove(hotel.hotelId)}>Approve</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Modal for showing hotel details */}
      <HotelDetailsModal
        show={showModal}
        onClose={handleCloseModal}
        hotelDetails={selectedHotel}
      />
    </div>
  );
};

export default HotelList;
